function putInField(data, col, lin, enter) {
	javelin.moveCursor(col, lin);
	javelin.doAction("KEY_ERASEEOF");
	if(data != "")
		javelin.send(data);
	if (enter) {
		javelin.doAction("KEY_ENTER");
		javelin.waitForDataStable(timeout, threshold);
	}
}

var table_values;

// Handles the transaction start event.
function onTransactionStarted() {
	if (table_values != null) {
		if (!table_values.equals("")) {
			table_values = table_values.split("|");
		}
	}
}

