// Handles the transaction start event.
function onTransactionStarted() {
	javelin.disconnect();
	javelin.connect(1000);
	javelin.waitForDataStable(timeout, threshold);
}

// Handles the XML generated event.
function onXmlGenerated() {
	var currentTable = context.get("currentTable");
	var rootElement = dom.getDocumentElement();
	if (currentTable != null) {
		var importedTable = dom.importNode(currentTable, true);
		rootElement.appendChild(importedTable);
	}
}
// Handles the transaction start event.
